import UIKit

class EmploymentDataRouter: EmploymentDataWireframeProtocol {
    weak var viewController: UIViewController?

    static func createModule() -> UIViewController {
        let view = EmploymentDataViewController()
        let interactor = EmploymentDataInteractor()
        let router = EmploymentDataRouter()
        let presenter = EmploymentDataPresenter(interface: view, interactor: interactor, router: router)

        view.presenter = presenter
        interactor.presenter = presenter
        router.viewController = view

        return view
    }
}
